import React from "react";
import ReactDOM from "react-dom";
import { useLocation } from "react-router-dom";
import App from "./App";

const location = useLocation();

ReactDOM.render(
  <React.StrictMode>
    <App location={location}/>
  </React.StrictMode>,
  document.getElementById("root")
);
